import React, { Component } from "react";

function getDate() {
      let date = new Date();

      let dayName = Intl.DateTimeFormat("en-US", {
            weekday: "short",
      }).format(date);

      let monthName = Intl.DateTimeFormat("en-US", {month: "long"}).format(date);

      let dateString = `${dayName}-${monthName}-${date.get}`;
      return dateString;
}

class Calendar extends Component {
      render() {
            return (
                  <>
                        <p> {getDate()}</p>
                  </>
            );
      }
}

export default Calendar;
